import React, { useState } from 'react';
import './App.css'; // Import your CSS file

const App = () => {
  const [teamNumber, setTeamNumber] = useState('');

  const handleInputChange = (event) => {
    setTeamNumber(event.target.value);
  };

  const handleSubmit = () => {
    const redirectUrl = `https://script.google.com/macros/s/AKfycbwDKr4tt6RbdVR5LtBECiheznDz9IWVzKETiuZHqgL35r44tsvvSPxf-mJRv4qla5oK1A/exec?spreadsheetId=1htzgArSyLu9kyl6Ed1SB4v_w5jiAn8oof7icfOzc1l8&sheetName=Sheet1&row=${teamNumber}`;
    window.location.href = redirectUrl;
  };

  return (
    <div className="app-container">
      <h1 className="heading">Flag Wars</h1>
      <p className="sub-heading">Brought to you by Team Technoinformals</p>
      <div className="input-container">
        <label htmlFor="teamNumber">Enter Your Team Number:</label>
        <input
          type="text"
          id="teamNumber"
          value={teamNumber}
          onChange={handleInputChange}
        />
      </div>
      <button className="submit-button" onClick={handleSubmit}>Submit</button>
    </div>
  );
};

export default App;
